import React from "react";
import Contacts from "../products";
import Card from "./Card";

const createCard=(contact) => {
    return (
        <Card 
            name = {contact.name}
            img = {contact.imgURL}
            tel = {contact.phone}
            email = {contact.email}
        />
    );
}

const productList = () => {
    return (
        <div className="container">
        {Contacts.map(createCard)}
    </div>
    );
}

export default productList;
